create table pop
(
    id                      int auto_increment,
    region                  varchar(30) not null,
    year                    int         not null,
    CS_pw                   double      not null,
    CS_nw                   double      not null,
    CS_rc_Bio               double      not null,
    CS_ps_Bio_SUM           double      null,
    CS_lf_mw_Bio            double      not null,
    CS_ner_mw_Bio           double      not null,
    CS_lf_iw                double      not null,
    CS_ner_iw               double      not null,
    AE_er_mw                double      null,
    AE_lf_mw_Bio            double      not null,
    AE_er_iw                double      not null,
    AE_WoodE                double      null,
    AE_lf_iw                double      null,
    CE_df                   double      null,
    CE_wh                   double      null,
    CE_nwh                  double      null,
    CE_rpc                  double      null,
    CE_chem_P               double      null,
    CE_wttrt_Pulp           double      null,
    CE_wttrt_Paper          double      null,
    CE_wttrt_ToNature_Pulp  double      null,
    CE_wttrt_ToNature_Paper double      null,
    CE_prd_ExBio            double      null,
    CE_prd_Bio              double      null,
    CE_inc_Bio              double      null,
    CE_er_mw_Bio            double      null,
    CO2_lf_mw_Bio           double      null,
    CE_lf_mw_Bio            double      null,
    CECP_lf_mw_Bio          double      null,
    CESC_lf_mw_Bio          double      null,
    CE_er_iw                double      null,
    CE_WoodE                double      null,
    CO2_lf_iw               double      null,
    CE_lf_iw                double      null,
    CECP_lf_iw              double      null,
    CESC_lf_iw              double      null,
    constraint pop_id_uindex
        unique (id)
);

alter table pop
    add primary key (id);

